import { Typography } from '@mui/material'
import { Box } from '@mui/system'
import React from 'react'

export const Destinations = () => {
  return (
    <Box sx={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh"
    }}>
        <Typography variant='h2'>Destinos</Typography>
    </Box>
  )
}
